Block.P:
global slMultiRobotEnv;
numRobots = evalin('base',get_param(gcb,'numRobots'));
slMultiRobotEnv = MultiRobotEnv(numRobots);
slMultiRobotEnv.hasWaypoints = true;

Mask.Initialization:
% Configure waypoints port
hasWaypointPort = isempty(find_system(gcb,'FollowLinks','on','LookUnderMasks','on','BlockType','Inport','Name','waypoints'));
if ~showWaypoints & ~hasWaypointPort
    replace_block(gcb,'FollowLinks','on','Name','waypoints','built-in/Ground','noprompt');
    hasWaypointPort = false;
elseif showWaypoints & hasWaypointPort
    replace_block(gcb,'FollowLinks','on','Name','waypoints','built-in/Inport','noprompt'); 
    hasWaypointPort = true;
end

% Configure objects port
hasObjectPort = isempty(find_system(gcb,'FollowLinks','on','LookUnderMasks','on','BlockType','Inport','Name','objects'));
if ~showObjects & ~hasObjectPort
    replace_block(gcb,'FollowLinks','on','Name','objects','built-in/Ground','noprompt');
    hasObjectPort = false;
elseif showObjects & hasObjectPort
    replace_block(gcb,'FollowLinks','on','Name','objects','built-in/Inport','noprompt');  
    hasObjectPort = true;
end

% Ensure the waypoints and objects ports are organized correctly
if strcmp(get_param([gcb '/waypoints'],'BlockType'),'Inport')
    set_param([gcb '/waypoints'],'Port','1');
end


global slMultiRobotEnv
if isa(slMultiRobotEnv,'MultiRobotEnv')
    release(slMultiRobotEnv) 
    slMultiRobotEnv.numRobots = numRobots;
    slMultiRobotEnv.mapName = mapName;
    slMultiRobotEnv.plotSensorLines = plotSensorLines;
    slMultiRobotEnv.showRobotIds = showRobotIds;
    slMultiRobotEnv.objectColors = objectColors;
    slMultiRobotEnv.objectMarkers = objectMarkers;

    % Show the visualizer
    setupVisualization(slMultiRobotEnv);
end

MaskParameter.Callback:
mask = Simulink.Mask.get(gcb);
showObjects = get_param(gcb,'showObjects');

% Enable and disable parameters
indices = [find(strcmp({mask.Parameters.Name},'objectColors'));
           find(strcmp({mask.Parameters.Name},'objectMarkers'))];

for idx = 1:numel(indices)
    mask.Parameters(indices(idx)).Visible = showObjects;
end

Mask.Initialization:
% Configure ranges port
if ~hasLidar & ~isempty(find_system(gcb,'FollowLinks','on','LookUnderMasks','on','BlockType','Inport','Name','ranges'))
    replace_block(gcb,'FollowLinks','on','Name','ranges','built-in/Ground','noprompt');
elseif hasLidar & isempty(find_system(gcb,'FollowLinks','on','LookUnderMasks','on','BlockType','Inport','Name','ranges'))
    replace_block(gcb,'FollowLinks','on','Name','ranges','built-in/Inport','noprompt');  
end

global slMultiRobotEnv
if isa(slMultiRobotEnv,'MultiRobotEnv')
    release(slMultiRobotEnv)

    % Color settings
    slMultiRobotEnv.robotColors(idx,:) = robotColor;

    % Radius setting
    slMultiRobotEnv.robotRadius(idx) = radius;

    % Trajectory setting
    slMultiRobotEnv.showTrajectory(idx) = showTraj;

    % Lidar property setting
    slMultiRobotEnv.hasLidar(idx) = hasLidar;
    slMultiRobotEnv.scanAngles{idx} = scanAngles;
    slMultiRobotEnv.sensorOffset{idx} = sensorOffset;

    % Object detector property setting
    slMultiRobotEnv.hasObjDetector(idx) = hasObjDetector;
    slMultiRobotEnv.objDetectorOffset{idx} = objDetectorOffset;
    slMultiRobotEnv.objDetectorAngle(idx) = objDetectorAngle;
    slMultiRobotEnv.objDetectorFOV(idx) = objDetectorFOV;
    slMultiRobotEnv.objDetectorMaxRange(idx) = objDetectorMaxRange;

end

MaskParameter.Callback:
mask = Simulink.Mask.get(gcb);
hasLidar = get_param(gcb,'hasLidar');

% Enable and disable parameters
indices = [find(strcmp({mask.Parameters.Name},'sensorOffset'));
           find(strcmp({mask.Parameters.Name},'scanAngles'))];

for idx = 1:numel(indices)
    mask.Parameters(indices(idx)).Visible = hasLidar;
end

mask = Simulink.Mask.get(gcb);
hasObjDetector = get_param(gcb,'hasObjDetector');

indices = [find(strcmp({mask.Parameters.Name},'objDetectorOffset'));
           find(strcmp({mask.Parameters.Name},'objDetectorAngle'));
           find(strcmp({mask.Parameters.Name},'objDetectorFOV'));
           find(strcmp({mask.Parameters.Name},'objDetectorMaxRange'))];

for idx = 1:numel(indices)
    mask.Parameters(indices(idx)).Visible = hasObjDetector;
end

Ts = evalin('base',get_param(gcb,'Ts'));
blk = [gcb '/Generic Robot Simulation/Velocity Integrator'];
if Ts > 0
    set_param(blk,'OverrideUsingVariant','mode==2');  
else
    set_param(blk,'OverrideUsingVariant','mode==1');  
end

